@iknaip is a music producer, cultural producer and DJ. Based in Porto Alegre, the city where he was born. He co-produces the collectives Turmalina and ZonaEXP. Since the beginning of his artistic career, he has focused on bringing new perspectives to electronic dance music. His productions and DJ sets explore a hypnotic yet balanced environment, aligning his aesthetic with house and techno trends. He has performed at several local and Brazilian events, such as ODD (SP), 1010 + Boiler Room (BH), Rádio Veneno (SP), Caldo Love (SP, in a special edition in RJ), Comuna (RJ). As a music producer, he had his first releases on the ZonaEXP label, participated in the compilation Escape from São Paulo, the In Their Feelings label and Anexo Projeto, Nice & Deadly (BSB) and XXIII (Portugal). He is currently developing his project
@dance.report and, together with the Turmalina collective, in 2021 he held Feijoada Turmalina, a project financed by Natura Musical for artistic immersion and promotion of scenes.

